  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:52.971421\",\n\t\"name\": \"waubay-wetland-management-district-annual-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Waubay
  Wetland Management District outlines Refuge accomplishments during the 1985 calendar
  year. The report begins by giving a brief introduction to the district, as well
  as the climatic conditions. The land acquisition program is discussed. The planning
  section discusses management planning, public participation, compliance with environmental
  and cultural resource mandates, and research and investigations. The administration
  section discusses personnel, youth programs, funding, safety, and technical assistance.
  Habitat management is discussed; topics include wetlands, croplands, grasslands,
  grazing, haying, fire management, pest control, water rights, and easement monitoring.
  Wildlife- including endangered and threatened species, waterfowl, marsh and water
  birds, shorebirds, raptors, other migratory birds, game mammals, other resident
  wildlife, and animal control- is also covered. The public use section discusses
  information and interpretation, hunting, fishing, trapping, other non-wildlife oriented
  recreation, and law enforcement. The equipment and facilities section discusses
  new construction, rehabilitation, major maintenance, equipment utilization and replacement,
  communications systems, computer systems, and energy conservation. Items of interest
  are discussed. Photographs and brochures are attached.\",\n\t\"license_title\":
